import React from "react";

import { withRouter } from "react-router";
import classes from "./Header.module.css";
import Mapa from "./../Mapa/Mapa";
import ArrowForwardIosIcon from "@material-ui/icons/ArrowForwardIos";
import ArrowBackIosIcon from "@material-ui/icons/ArrowBackIos";

function Header(props) {
  const routes = [
    "Formas",
    "Medidas",
    "Modelos",
    "Generos",
    "Colores",
    "Tachas",
  ];

  let arrowRight = (
    <svg
    className={classes.ArrowRight}
    onClick={() => props.toggleRight(pathname)}
      width="37"
      height="50"
      viewBox="0 0 37 74"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path d="M3 2L33 38.8L5.17391 72" stroke="#404145" stroke-width="6" />
    </svg>
  );

  let arrowLeft = (
    <svg
    className={classes.ArrowLeft}
    onClick={() => props.toggleLeft(pathname)}
      width="37"
      height="50"
      viewBox="0 0 37 74"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path d="M34 72L4 35.2L31.8261 2" stroke="#404145" stroke-width="6" />
    </svg>
  );

  const pathname = props.history.location.pathname;
  return (
    <div className={classes.Header}>
      {arrowRight}

      <h2>
        #{props.index + 1}: {routes[props.index]}
      </h2>

      {arrowLeft}
      <Mapa routes={routes} index={props.index} />
    </div>
  );
}

export default withRouter(Header);
